import Navbar from "./components/Navbar";

function App() {
  let component
  switch(window.location.pathname){
    case '/':
      component = <App />
    case '/Register':
      component = <Register />
    case '/Reservation':
      component = <Reservation />
  }

  return (
    <div className="App">
      <Navbar />
    </div>
  );
}

export default App;
